import { RequestWrapper } from './Helpers';
export function GetAthlete(devId, apiKey, userId, toWebhook = true) {
    const requestOptions = {
        method: 'GET',
        headers: {
            'X-API-Key': apiKey,
            'dev-id': devId,
            'Content-Type': 'application/json',
        },
    };
    const requestParams = {
        user_id: userId,
        to_webhook: toWebhook,
    };
    return RequestWrapper('athlete', requestOptions, requestParams);
}
